  console.error(error);

  return (
    <>
      <Header />
      <div className="text-center p-10">
        <h1 className="text-4xl font-bold text-red-600 mb-4">Oops! ðŸš¨</h1>
        <p className="text-lg">Looks like something went wrong.</p>
        {error?.statusText || error?.message ? (
          <p className="mt-4 text-sm text-gray-500">
            {error.statusText || error.message}
          </p>
        ) : null}
      </div>
    </>
  );
};

export default ErrorPage;
